# Marko
def jo_uj_szo_e(uj_szo, szavak):
    if not magyar_szo_e(uj_szo):
        return False
    if uj_szo in szavak:
        return False
    if szavak[-1][-1] != uj_szo[0]:
        return False
    return True

# Sanyi
